  "text" : "\uCE5C\uAD6C\uB294 \uAC00\uC5C5\uC744 \uBB3C\uB824 \uBC1B\uC73C\uB824\uACE0 \uACBD\uD76C\uB300 \uD55C\uC758\uB300 \uAC00\uB824\uACE0 \uBB34\uB824 6\uB144\uAC04 \uC218\uB2A5\uC744 \uBD24\uB2E4. \uCC98\uC74C\uC5D0 \uACBD\uD76C\uB300 \uD55C\uC758\uB300 \uAC04\uB2E4\uACE0 \uACE0\uB4F1\uD559\uAD50 \uB54C \uB9D0\uD560 \uB54C \uC644\uC804 \uBE44\uC6C3\uC5C8\uB294\uB370, \uACB0\uAD6D \uD559\uAD50\uC640 \uD559\uAD50\uB97C \uBAA9\uD45C\uB85C \uB9DE\uCDB0\uB193\uACE0 \uACF5\uC744 \uB4E4\uC774\uB2C8 \uAC00\uAE34 \uAC00\uB354\uB77C. \uADFC\uB370 \uC785\uD559\uD558\uB2C8 \uADF8\uB7F0 \uC560\uB4E4\uC774 \uC5C4\uCCAD \uB9CE\uC558\uB2E4\uACE0.",
